// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "../libraries/LuxTensorAI.sol";
import "../interfaces/ISemanticRegistry.sol";
import "../interfaces/ILuxTensorAI.sol";

/**
 * @title TrustGraph - Social Trust Scoring System
 * @notice Semantic-based reputation and trust classification
 * @dev Real-world case study: Cross-protocol reputation with AI classification
 *
 * Use Cases:
 * - DeFi: Under-collateralized lending based on reputation
 * - DAO: Voting weight based on trust score
 * - Marketplace: Buyer/seller trust verification
 * - Social: Content creator authenticity
 *
 * Architecture:
 * 1. User behavior is encoded into reputation vectors
 * 2. Vectors are registered in Social domain
 * 3. Trust classification uses k-NN against labeled profiles
 * 4. Cross-protocol queries enable portable reputation
 *
 * Trust Levels:
 * - 0: Unknown (new or insufficient data)
 * - 1: Risky (flagged behavior patterns)
 * - 2: Neutral (normal behavior)
 * - 3: Trusted (positive behavior patterns)
 * - 4: Verified (exceptional reputation)
 */
contract TrustGraph is Ownable, ReentrancyGuard {
    // ==================== ENUMS ====================

    /// @notice Trust classification levels
    enum TrustLevel {
        Unknown, // 0 - New user, insufficient data
        Risky, // 1 - Flagged patterns
        Neutral, // 2 - Normal behavior
        Trusted, // 3 - Good reputation
        Verified // 4 - Exceptional
    }

    // ==================== STRUCTS ====================

    /// @notice User trust profile
    struct TrustProfile {
        uint64 vectorId; // Global ID in Social domain
        TrustLevel level; // Current classification
        uint256 confidence; // Classification confidence (0-1e18)
        uint256 positiveActions; // Count of positive signals
        uint256 negativeActions; // Count of negative signals
        uint256 lastUpdated; // Timestamp
        bool isVerified; // Manual verification status
    }

    /// @notice Trust attestation from another protocol
    struct Attestation {
        address attester; // Protocol that attested
        TrustLevel attestedLevel; // Attested trust level
        uint256 weight; // Attestation weight
        uint256 timestamp;
        string reason;
    }

    /// @notice Reference profile for classification
    struct ReferenceProfile {
        uint64 vectorId;
        TrustLevel level;
        uint256 weight;
    }

    // ==================== STATE ====================

    /// @notice User profiles
    mapping(address => TrustProfile) public profiles;

    /// @notice Attestations per user
    mapping(address => Attestation[]) public attestations;

    /// @notice Approved attesters (protocols that can attest)
    mapping(address => bool) public approvedAttesters;

    /// @notice Reference profiles for classification (per trust level)
    mapping(TrustLevel => ReferenceProfile[]) public referenceProfiles;

    /// @notice Embedding dimension
    uint256 public embeddingDimension;

    /// @notice Minimum confidence for valid classification
    uint256 public minConfidence;

    /// @notice Attestation weight thresholds
    uint256 public constant WEIGHT_THRESHOLD = 1000;

    // ==================== EVENTS ====================

    event ProfileCreated(address indexed user, uint64 vectorId);

    event TrustClassified(
        address indexed user,
        TrustLevel level,
        uint256 confidence
    );

    event AttestationReceived(
        address indexed user,
        address indexed attester,
        TrustLevel level
    );

    event TrustLevelUpgraded(
        address indexed user,
        TrustLevel from,
        TrustLevel to
    );

    event TrustLevelDowngraded(
        address indexed user,
        TrustLevel from,
        TrustLevel to
    );

    event ReferenceProfileAdded(TrustLevel level, uint64 vectorId);

    // ==================== ERRORS ====================

    error ProfileNotFound(address user);
    error InvalidConfidence(uint256 confidence);
    error UnauthorizedAttester(address attester);
    error InsufficientData(address user);
    error AlreadyVerified(address user);
    error MaxAttestationsReached(address user);

    // ==================== CONSTANTS ====================

    /// @notice Maximum attestations per user to prevent Gas DoS
    /// @dev CR-12 security fix
    uint256 public constant MAX_ATTESTATIONS = 100;

    // ==================== CONSTRUCTOR ====================

    /**
     * @notice Initialize TrustGraph
     * @param dimension_ Reputation embedding dimension
     * @param minConfidence_ Minimum classification confidence
     */
    constructor(
        uint256 dimension_,
        uint256 minConfidence_
    ) Ownable(msg.sender) {
        embeddingDimension = dimension_;
        minConfidence = minConfidence_;
    }

    // ==================== PROFILE MANAGEMENT ====================

    /**
     * @notice Register a user's trust profile
     * @param user User address
     * @param behaviorEmbedding Initial behavior embedding
     * @param tags Profile tags
     * @return vectorId Global vector ID
     *
     * @dev Example:
     * ```solidity
     * // Protocol registers user after observing behavior
     * int256[] memory embedding = encodeUserBehavior(
     *     txCount,
     *     avgTxValue,
     *     protocolInteractions,
     *     accountAge
     * );
     * bytes32[] memory tags = [keccak256("defi_user")];
     * trustGraph.registerProfile(user, embedding, tags);
     * ```
     */
    function registerProfile(
        address user,
        int256[] calldata behaviorEmbedding,
        bytes32[] calldata tags
    ) external nonReentrant returns (uint64 vectorId) {
        require(
            behaviorEmbedding.length == embeddingDimension,
            "Invalid dimension"
        );
        require(profiles[user].vectorId == 0, "Profile exists");

        // Register in Social domain
        (vectorId, ) = LuxTensorAI.registerVector(
            ISemanticRegistry.SemanticDomain.Social,
            behaviorEmbedding,
            tags,
            0 // Permanent
        );

        profiles[user] = TrustProfile({
            vectorId: vectorId,
            level: TrustLevel.Unknown,
            confidence: 0,
            positiveActions: 0,
            negativeActions: 0,
            lastUpdated: block.timestamp,
            isVerified: false
        });

        emit ProfileCreated(user, vectorId);
    }

    /**
     * @notice Classify user's trust level using AI
     * @param user User to classify
     * @return level Classified trust level
     * @return confidence Classification confidence
     *
     * @dev Uses k-NN classification against reference profiles
     */
    function classifyTrust(
        address user
    ) external nonReentrant returns (TrustLevel level, uint256 confidence) {
        TrustProfile storage profile = profiles[user];
        if (profile.vectorId == 0) revert ProfileNotFound(user);

        // Get user's embedding
        (bool exists, int256[] memory embedding) = LuxTensorAI.semanticRelate(
            profile.vectorId
        );
        require(exists, "Vector not found");

        // Build labeled vectors from reference profiles
        uint256 totalRefs = _countReferenceProfiles();
        if (totalRefs < 3) revert InsufficientData(user);

        ILuxTensorAI.LabeledVector[] memory labels = _buildLabeledVectors();

        // Classify using k-NN
        uint32 classLabel;
        (classLabel, confidence) = LuxTensorAI.classify(embedding, labels, 5);

        level = TrustLevel(classLabel);

        // Update profile if confidence is sufficient
        if (confidence >= minConfidence) {
            TrustLevel oldLevel = profile.level;
            profile.level = level;
            profile.confidence = confidence;
            profile.lastUpdated = block.timestamp;

            emit TrustClassified(user, level, confidence);

            if (level > oldLevel) {
                emit TrustLevelUpgraded(user, oldLevel, level);
            } else if (level < oldLevel) {
                emit TrustLevelDowngraded(user, oldLevel, level);
            }
        }
    }

    /**
     * @notice Get trust level for a user (view only)
     * @param user User address
     * @return level Current trust level
     * @return confidence Classification confidence
     * @return isStale True if profile needs reclassification
     */
    function getTrustLevel(
        address user
    )
        external
        view
        returns (TrustLevel level, uint256 confidence, bool isStale)
    {
        TrustProfile storage profile = profiles[user];
        if (profile.vectorId == 0) {
            return (TrustLevel.Unknown, 0, true);
        }

        level = profile.level;
        confidence = profile.confidence;

        // Consider stale if older than 7 days
        isStale = block.timestamp > profile.lastUpdated + 7 days;
    }

    /**
     * @notice Check if user meets trust requirement
     * @param user User to check
     * @param minLevel Minimum required trust level
     * @return meets True if user meets requirement
     * @return actual User's actual trust level
     */
    function meetsTrustRequirement(
        address user,
        TrustLevel minLevel
    ) external view returns (bool meets, TrustLevel actual) {
        TrustProfile storage profile = profiles[user];
        if (profile.vectorId == 0) {
            return (minLevel == TrustLevel.Unknown, TrustLevel.Unknown);
        }

        actual = profile.level;
        meets = uint8(actual) >= uint8(minLevel);
    }

    // ==================== ATTESTATIONS ====================

    /**
     * @notice Attest to a user's trust level (protocol-to-protocol)
     * @param user User to attest
     * @param level Attested trust level
     * @param weight Attestation weight
     * @param reason Reason for attestation
     *
     * @dev Only approved attesters can call this
     *
     * Example:
     * ```solidity
     * // DeFi protocol attests after successful loan repayment
     * trustGraph.attest(borrower, TrustLevel.Trusted, 100, "Repaid 5 loans");
     * ```
     */
    function attest(
        address user,
        TrustLevel level,
        uint256 weight,
        string calldata reason
    ) external nonReentrant {
        if (!approvedAttesters[msg.sender]) {
            revert UnauthorizedAttester(msg.sender);
        }

        TrustProfile storage profile = profiles[user];
        if (profile.vectorId == 0) revert ProfileNotFound(user);
        // CR-12: Prevent unbounded attestation arrays
        if (attestations[user].length >= MAX_ATTESTATIONS)
            revert MaxAttestationsReached(user);

        attestations[user].push(
            Attestation({
                attester: msg.sender,
                attestedLevel: level,
                weight: weight,
                timestamp: block.timestamp,
                reason: reason
            })
        );

        // Update action counts based on attestation
        if (level >= TrustLevel.Trusted) {
            profile.positiveActions += weight;
        } else if (level == TrustLevel.Risky) {
            profile.negativeActions += weight;
        }

        emit AttestationReceived(user, msg.sender, level);
    }

    /**
     * @notice Get aggregated attestation score
     * @param user User address
     * @return totalWeight Total attestation weight
     * @return avgLevel Average attested level (scaled by 1e18)
     */
    function getAttestationScore(
        address user
    ) external view returns (uint256 totalWeight, uint256 avgLevel) {
        Attestation[] storage userAttestations = attestations[user];
        if (userAttestations.length == 0) return (0, 0);

        uint256 weightedSum = 0;
        for (uint256 i = 0; i < userAttestations.length; i++) {
            totalWeight += userAttestations[i].weight;
            weightedSum +=
                uint256(userAttestations[i].attestedLevel) *
                userAttestations[i].weight;
        }

        avgLevel = (weightedSum * 1e18) / totalWeight;
    }

    // ==================== REFERENCE MANAGEMENT ====================

    /**
     * @notice Add reference profile for classification
     * @param level Trust level this reference represents
     * @param embedding Reference behavior embedding
     * @param weight Reference weight for classification
     */
    function addReferenceProfile(
        TrustLevel level,
        int256[] calldata embedding,
        uint256 weight
    ) external onlyOwner returns (uint64 vectorId) {
        require(embedding.length == embeddingDimension, "Invalid dimension");

        // Register reference in Social domain
        bytes32[] memory tags = new bytes32[](1);
        tags[0] = keccak256(abi.encode("reference", uint8(level)));

        (vectorId, ) = LuxTensorAI.registerVector(
            ISemanticRegistry.SemanticDomain.Social,
            embedding,
            tags,
            0
        );

        referenceProfiles[level].push(
            ReferenceProfile({vectorId: vectorId, level: level, weight: weight})
        );

        emit ReferenceProfileAdded(level, vectorId);
    }

    // ==================== ADMIN ====================

    /**
     * @notice Approve an attester protocol
     * @param attester Protocol address
     */
    function approveAttester(address attester) external onlyOwner {
        approvedAttesters[attester] = true;
    }

    /**
     * @notice Revoke attester approval
     * @param attester Protocol address
     */
    function revokeAttester(address attester) external onlyOwner {
        approvedAttesters[attester] = false;
    }

    /**
     * @notice Manually verify a user
     * @param user User to verify
     */
    function verifyUser(address user) external onlyOwner {
        TrustProfile storage profile = profiles[user];
        if (profile.vectorId == 0) revert ProfileNotFound(user);
        if (profile.isVerified) revert AlreadyVerified(user);

        profile.isVerified = true;
        profile.level = TrustLevel.Verified;
        profile.confidence = 1e18; // 100% confidence

        emit TrustClassified(user, TrustLevel.Verified, 1e18);
    }

    /**
     * @notice Update minimum confidence threshold
     * @param newMinConfidence New threshold (0-1e18)
     */
    function setMinConfidence(uint256 newMinConfidence) external onlyOwner {
        require(newMinConfidence <= 1e18, "Invalid confidence");
        minConfidence = newMinConfidence;
    }

    // ==================== INTERNAL ====================

    /**
     * @dev Count total reference profiles
     */
    function _countReferenceProfiles() internal view returns (uint256 total) {
        for (uint8 i = 0; i <= uint8(TrustLevel.Verified); i++) {
            total += referenceProfiles[TrustLevel(i)].length;
        }
    }

    /**
     * @dev Build labeled vectors array for classification
     */
    function _buildLabeledVectors()
        internal
        view
        returns (ILuxTensorAI.LabeledVector[] memory labels)
    {
        uint256 total = _countReferenceProfiles();
        labels = new ILuxTensorAI.LabeledVector[](total);

        uint256 idx = 0;
        for (uint8 i = 0; i <= uint8(TrustLevel.Verified); i++) {
            ReferenceProfile[] storage refs = referenceProfiles[TrustLevel(i)];
            for (uint256 j = 0; j < refs.length; j++) {
                labels[idx] = ILuxTensorAI.LabeledVector({
                    vectorId: refs[j].vectorId,
                    label: uint32(i)
                });
                idx++;
            }
        }
    }

    // ==================== VIEW ====================

    /**
     * @notice Get user's full profile
     * @param user User address
     * @return Profile data
     */
    function getProfile(
        address user
    ) external view returns (TrustProfile memory) {
        return profiles[user];
    }

    /**
     * @notice Get attestations for a user
     * @param user User address
     * @return Array of attestations
     */
    function getAttestations(
        address user
    ) external view returns (Attestation[] memory) {
        return attestations[user];
    }

    /**
     * @notice Check if address is approved attester
     * @param attester Address to check
     * @return True if approved
     */
    function isApprovedAttester(address attester) external view returns (bool) {
        return approvedAttesters[attester];
    }
}

src/GradientAggregator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/**
 * @title GradientAggregator
 * @notice Decentralized federated learning gradient aggregation on LuxTensor
 * @dev Implements FedAvg algorithm for on-chain training coordination
 *
 * Architecture:
 * 1. dApp creates training job with model, dataset, and rewards
 * 2. Miners register as trainers for the job
 * 3. Each round: trainers submit gradient hashes with PoT proofs
 * 4. Aggregation triggers round completion and reward distribution
 */
contract GradientAggregator is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;

    // ==================== STATE ====================

    /// @notice Training job status lifecycle
    enum JobStatus {
        Open, // Accepting trainer registrations
        Training, // Active training rounds
        Aggregating, // Waiting for gradient aggregation
        Completed, // All rounds finished successfully
        Cancelled // Job cancelled by creator
    }

    /// @notice Training job configuration and state
    struct TrainingJob {
        bytes32 modelId; // IPFS CID of base model
        bytes32 datasetRef; // IPFS reference to dataset descriptor
        uint256 totalRounds; // Total training rounds
        uint256 currentRound; // Current round (0-indexed)
        uint256 minParticipants; // Minimum trainers per round
        uint256 rewardPerRound; // MDT reward per round
        address creator; // Job creator
        JobStatus status; // Current status
        uint256 createdAt; // Creation timestamp
        uint256 depositedRewards; // Total MDT deposited
    }

    /// @notice Gradient submission for a round
    struct GradientSubmission {
        address trainer; // Trainer address
        bytes32 gradientHash; // Hash of gradient vectors
        bytes32 checkpointHash; // Model checkpoint hash for PoT
        uint256 timestamp; // Submission time
        bool verified; // PoT verification status
    }

    /// @notice MDT token for rewards
    IERC20 public immutable mdtToken;

    /// @notice Job counter
    uint256 public nextJobId;

    /// @notice Jobs by ID
    mapping(uint256 => TrainingJob) public jobs;

    /// @notice Trainers registered for each job
    mapping(uint256 => address[]) public jobTrainers;

    /// @notice Is trainer registered for job
    mapping(uint256 => mapping(address => bool)) public isTrainer;

    /// @notice Gradient submissions per job per round
    mapping(uint256 => mapping(uint256 => GradientSubmission[]))
        public roundSubmissions;

    /// @notice Aggregated model checkpoints per job per round
    mapping(uint256 => mapping(uint256 => bytes32)) public roundCheckpoints;

    // ==================== EVENTS ====================

    event JobCreated(
        uint256 indexed jobId,
        bytes32 indexed modelId,
        address creator,
        uint256 totalRounds,
        uint256 rewardPerRound
    );

    event TrainerRegistered(uint256 indexed jobId, address indexed trainer);

    event TrainingStarted(uint256 indexed jobId, uint256 participantCount);

    event GradientSubmitted(
        uint256 indexed jobId,
        uint256 indexed round,
        address indexed trainer,
        bytes32 gradientHash
    );

    event RoundCompleted(
        uint256 indexed jobId,
        uint256 indexed round,
        bytes32 aggregatedCheckpoint,
        uint256 submissionCount
    );

    event JobCompleted(uint256 indexed jobId, uint256 totalRounds);

    event JobCancelled(uint256 indexed jobId, uint256 refundAmount);

    event RewardDistributed(
        uint256 indexed jobId,
        uint256 indexed round,
        address indexed trainer,
        uint256 amount
    );

    // ==================== ERRORS ====================

    error InvalidParameters();
    error InsufficientDeposit();
    error JobNotOpen();
    error JobNotTraining();
    error AlreadyRegistered();
    error NotRegistered();
    error RoundNotActive();
    error AlreadySubmitted();
    error InsufficientSubmissions();
    error NotJobCreator();
    error MaxParticipantsReached();

    // ==================== CONSTANTS ====================

    /// @notice Maximum participants per job to prevent Gas DoS
    /// @dev CR-10 security fix
    uint256 public constant MAX_PARTICIPANTS = 1000;

    // ==================== CONSTRUCTOR ====================

    constructor(address _mdtToken) Ownable(msg.sender) {
        if (_mdtToken == address(0)) revert InvalidParameters();
        mdtToken = IERC20(_mdtToken);
    }

    // ==================== JOB MANAGEMENT ====================

    /**
     * @notice Create a new training job
     * @param modelId IPFS CID of the base model
     * @param datasetRef IPFS reference to dataset
     * @param totalRounds Number of training rounds
     * @param minParticipants Minimum trainers per round
     * @param rewardPerRound MDT reward per round
     * @return jobId The created job ID
     */
    function createJob(
        bytes32 modelId,
        bytes32 datasetRef,
        uint256 totalRounds,
        uint256 minParticipants,
        uint256 rewardPerRound
    ) external nonReentrant returns (uint256 jobId) {
        if (modelId == bytes32(0) || totalRounds == 0 || minParticipants == 0) {
            revert InvalidParameters();
        }

        uint256 totalRewards = totalRounds * rewardPerRound;
        if (totalRewards == 0) revert InvalidParameters();

        // Transfer rewards from creator
        mdtToken.safeTransferFrom(msg.sender, address(this), totalRewards);

        jobId = nextJobId++;
        jobs[jobId] = TrainingJob({
            modelId: modelId,
            datasetRef: datasetRef,
            totalRounds: totalRounds,
            currentRound: 0,
            minParticipants: minParticipants,
            rewardPerRound: rewardPerRound,
            creator: msg.sender,
            status: JobStatus.Open,
            createdAt: block.timestamp,
            depositedRewards: totalRewards
        });

        emit JobCreated(
            jobId,
            modelId,
            msg.sender,
            totalRounds,
            rewardPerRound
        );
    }

    /**
     * @notice Register as a trainer for a job
     * @param jobId Job to register for
     * @dev CR-10: Added MAX_PARTICIPANTS check to prevent Gas DoS
     */
    function registerAsTrainer(uint256 jobId) external {
        TrainingJob storage job = jobs[jobId];
        if (job.status != JobStatus.Open) revert JobNotOpen();
        if (isTrainer[jobId][msg.sender]) revert AlreadyRegistered();
        // CR-10: Prevent unbounded participant arrays
        if (jobTrainers[jobId].length >= MAX_PARTICIPANTS)
            revert MaxParticipantsReached();

        isTrainer[jobId][msg.sender] = true;
        jobTrainers[jobId].push(msg.sender);

        emit TrainerRegistered(jobId, msg.sender);

        // Auto-start if minimum participants reached
        if (jobTrainers[jobId].length >= job.minParticipants) {
            job.status = JobStatus.Training;
            emit TrainingStarted(jobId, jobTrainers[jobId].length);
        }
    }

    // ==================== TRAINING ====================

    /**
     * @notice Submit gradient for current round
     * @param jobId Job ID
     * @param gradientHash Hash of gradient vectors (IPFS CID recommended)
     * @param checkpointHash Model checkpoint hash for PoT verification
     */
    function submitGradient(
        uint256 jobId,
        bytes32 gradientHash,
        bytes32 checkpointHash
    ) external nonReentrant {
        TrainingJob storage job = jobs[jobId];
        if (job.status != JobStatus.Training) revert JobNotTraining();
        if (!isTrainer[jobId][msg.sender]) revert NotRegistered();

        uint256 round = job.currentRound;
        GradientSubmission[] storage submissions = roundSubmissions[jobId][
            round
        ];

        // Check not already submitted
        for (uint256 i = 0; i < submissions.length; i++) {
            if (submissions[i].trainer == msg.sender) revert AlreadySubmitted();
        }

        submissions.push(
            GradientSubmission({
                trainer: msg.sender,
                gradientHash: gradientHash,
                checkpointHash: checkpointHash,
                timestamp: block.timestamp,
                verified: true // TODO: Implement PoT verification
            })
        );

        emit GradientSubmitted(jobId, round, msg.sender, gradientHash);

        // Check if round is complete
        if (submissions.length >= job.minParticipants) {
            _completeRound(jobId);
        }
    }

    /**
     * @dev Complete current round and distribute rewards
     */
    function _completeRound(uint256 jobId) internal {
        TrainingJob storage job = jobs[jobId];
        uint256 round = job.currentRound;
        GradientSubmission[] storage submissions = roundSubmissions[jobId][
            round
        ];

        // Calculate aggregated checkpoint (simplified: hash of all gradients)
        bytes32 aggregatedCheckpoint = _aggregateGradients(jobId, round);
        roundCheckpoints[jobId][round] = aggregatedCheckpoint;

        // Distribute rewards proportionally
        uint256 rewardPerTrainer = job.rewardPerRound / submissions.length;
        for (uint256 i = 0; i < submissions.length; i++) {
            if (submissions[i].verified) {
                mdtToken.safeTransfer(submissions[i].trainer, rewardPerTrainer);
                emit RewardDistributed(
                    jobId,
                    round,
                    submissions[i].trainer,
                    rewardPerTrainer
                );
            }
        }

        emit RoundCompleted(
            jobId,
            round,
            aggregatedCheckpoint,
            submissions.length
        );

        // Move to next round or complete
        job.currentRound++;
        if (job.currentRound >= job.totalRounds) {
            job.status = JobStatus.Completed;
            emit JobCompleted(jobId, job.totalRounds);
        }
    }

    /**
     * @dev Aggregate gradients using FedAvg (simplified on-chain version)
     * @return aggregatedHash Hash representing aggregated model state
     */
    function _aggregateGradients(
        uint256 jobId,
        uint256 round
    ) internal view returns (bytes32) {
        GradientSubmission[] storage submissions = roundSubmissions[jobId][
            round
        ];

        // Simple aggregation: keccak256 of all gradient hashes
        // Real FedAvg would happen off-chain with this as commitment
        bytes memory combined;
        for (uint256 i = 0; i < submissions.length; i++) {
            combined = abi.encodePacked(combined, submissions[i].gradientHash);
        }
        return keccak256(combined);
    }

    // ==================== JOB CONTROL ====================

    /**
     * @notice Cancel job and refund remaining rewards (creator only)
     * @param jobId Job to cancel
     */
    function cancelJob(uint256 jobId) external nonReentrant {
        TrainingJob storage job = jobs[jobId];
        if (msg.sender != job.creator) revert NotJobCreator();
        if (
            job.status == JobStatus.Completed ||
            job.status == JobStatus.Cancelled
        ) {
            revert InvalidParameters();
        }

        // Calculate remaining rewards
        uint256 completedRounds = job.currentRound;
        uint256 usedRewards = completedRounds * job.rewardPerRound;
        uint256 refundAmount = job.depositedRewards - usedRewards;

        job.status = JobStatus.Cancelled;

        if (refundAmount > 0) {
            mdtToken.safeTransfer(job.creator, refundAmount);
        }

        emit JobCancelled(jobId, refundAmount);
    }

    // ==================== VIEW FUNCTIONS ====================

    /**
     * @notice Get job details
     */
    function getJob(uint256 jobId) external view returns (TrainingJob memory) {
        return jobs[jobId];
    }

    /**
     * @notice Get trainers for a job
     */
    function getJobTrainers(
        uint256 jobId
    ) external view returns (address[] memory) {
        return jobTrainers[jobId];
    }

    /**
     * @notice Get submissions for a round
     */
    function getRoundSubmissions(
        uint256 jobId,
        uint256 round
    ) external view returns (GradientSubmission[] memory) {
        return roundSubmissions[jobId][round];
    }

    /**
     * @notice Get active jobs count
     */
    function getActiveJobsCount() external view returns (uint256 count) {
        for (uint256 i = 0; i < nextJobId; i++) {
            if (
                jobs[i].status == JobStatus.Open ||
                jobs[i].status == JobStatus.Training
            ) {
                count++;
            }
        }
    }
}

src/interfaces/ILuxTensorAI.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title ILuxTensorAI - Interface for LuxTensor AI Primitives
 * @notice Native AI operations accessible via precompiles (0x22-0x26)
 * @dev Each function maps to a specific precompile address
 *
 * Precompile Addresses:
 * - 0x22: CLASSIFY - k-NN classification with confidence
 * - 0x23: CLUSTER_ASSIGN - Assign to nearest cluster
 * - 0x24: ANOMALY_SCORE - Anomaly detection score
 * - 0x25: SIMILARITY_GATE - Semantic access control
 * - 0x26: SEMANTIC_RELATE - Cross-contract vector sharing
 */
interface ILuxTensorAI {
    // ==================== ERRORS ====================

    /// @notice Vector dimension mismatch
    error DimensionMismatch(uint256 expected, uint256 got);

    /// @notice Precompile call failed
    error PrecompileFailed(address precompile, bytes reason);

    /// @notice Vector not found in store
    error VectorNotFound(uint64 vectorId);

    /// @notice Insufficient gas for operation
    error InsufficientGas(uint256 required, uint256 provided);

    // ==================== EVENTS ====================

    /// @notice Emitted when classification is performed
    event Classification(
        address indexed caller,
        uint32 label,
        uint256 confidence
    );

    /// @notice Emitted when anomaly is detected
    event AnomalyDetected(
        address indexed caller,
        uint256 score,
        bool isAnomaly
    );

    /// @notice Emitted when similarity gate is checked
    event SimilarityChecked(
        address indexed caller,
        uint256 similarity,
        bool passed
    );

    // ==================== STRUCTS ====================

    /// @notice Labeled vector for classification
    struct LabeledVector {
        uint64 vectorId;
        uint32 label;
    }

    /// @notice Classification result
    struct ClassifyResult {
        uint32 label;
        uint256 confidence; // 0-1e18 (18 decimals)
    }

    /// @notice Cluster assignment result
    struct ClusterResult {
        uint64 centroidId;
        uint256 distance;
    }

    /// @notice Similarity check result
    struct SimilarityResult {
        bool passed;
        uint256 similarity; // 0-1e18 (18 decimals)
    }

    // ==================== VIEW FUNCTIONS ====================

    /**
     * @notice Classify a query vector using k-NN
     * @param query The query vector (fixed-point float32 array)
     * @param labels Array of labeled vectors for classification
     * @param k Number of neighbors to consider
     * @return result Classification result with label and confidence
     *
     * @dev Calls precompile at 0x22
     * Gas: ~25,000 base + 100 per label
     */
    function classify(
        int256[] calldata query,
        LabeledVector[] calldata labels,
        uint256 k
    ) external view returns (ClassifyResult memory result);

    /**
     * @notice Assign query to nearest cluster centroid
     * @param query The query vector
     * @param centroidIds Array of centroid vector IDs
     * @return result Nearest centroid ID and distance
     *
     * @dev Calls precompile at 0x23
     * Gas: ~28,000 base + 50 per centroid
     */
    function clusterAssign(
        int256[] calldata query,
        uint64[] calldata centroidIds
    ) external view returns (ClusterResult memory result);

    /**
     * @notice Calculate anomaly score for query vector
     * @param query The query vector
     * @return score Anomaly score (0-1e18, higher = more anomalous)
     * @return isAnomaly True if score exceeds default threshold (0.7)
     *
     * @dev Calls precompile at 0x24
     * Gas: ~30,000 base
     */
    function anomalyScore(
        int256[] calldata query
    ) external view returns (uint256 score, bool isAnomaly);

    /**
     * @notice Check semantic similarity between two vectors
     * @param vectorA First vector
     * @param vectorB Second vector
     * @param threshold Minimum similarity to pass (0-1e18)
     * @return result Similarity result with pass/fail and score
     *
     * @dev Calls precompile at 0x25
     * Gas: ~10,000 base
     */
    function similarityGate(
        int256[] calldata vectorA,
        int256[] calldata vectorB,
        uint256 threshold
    ) external view returns (SimilarityResult memory result);

    /**
     * @notice Retrieve a vector by ID for cross-contract sharing
     * @param vectorId The vector ID to retrieve
     * @return exists Whether the vector exists
     * @return vector The vector data (empty if not found)
     *
     * @dev Calls precompile at 0x26
     * Gas: ~20,000 base
     */
    function semanticRelate(
        uint64 vectorId
    ) external view returns (bool exists, int256[] memory vector);
}

